import React, { Component } from "react";

class NavPage extends Component {
  state = {
    visibility: 0,
  };
  render() {
    return (
      <div
        style={{
          backgroundColor: "rgba(252, 186, 3, .8)",
          width: 450,
          height: "163vh",
          position: "absolute",
          right: 0,
          zIndex: 1,
          opacity: this.state.visibility,
        }}
      ></div>
    );
  }
}

export default NavPage;
